import React from 'react'
import customfooter from '../../vectors/footer/customfooter.svg'

const CustomFooter = () => {
    return (
        <div class="custom-footer">
           <img src={customfooter} alt="footer"/> 
        </div>
    )
}

export default CustomFooter
